        return [[1, n]] + gen_combinations(n - 1)

    def find_solution(n: int) -> str:
        combinations = gen_combinations(n)
        solution = 0
        for combination in combinations:
            solution += combination[0] * combination[1]
        if solution == n:
            return 1
        if solution > n:
            return 0
        return solution

    def find_solution_binary_search(n: int) -> str:
        if n == 1:
            return 1
        if n == 2:
            return 2
        if n == 3:
            return 3
        mid = n // 2
        while True:
            result = find_solution(mid)
            if result == 0:
                lower_bound = mid
                mid = (lower_bound + mid) // 2
            elif result == 1:
                upper_bound = mid
                mid = (lower_bound + mid + 1) // 2
            else:
