    """
    Time complexity: O(n x log n)
    Space complexity: O(n)
    """
    n, k = map(int, stdin.split())
    l = []
    for _ in range(n):
        l.append(map(int, stdin.split()))
    # get the left most and right most point in each segment
    l = sorted(l, key=lambda x: x[0])
    r = sorted(l, key=lambda x: x[1])
    # then we can binary search to find the left and right points
    # and find out which one is the farthest left and right
    # and the minimum number of removed segments
    def isBad(x):
        count = 1
        for i in range(n):
            if l[i][0] <= x <= l[i][1]:
                count += 1
                if count > k:
                    return True
            if r[i][0] <= x <= r[i][1]:
                count += 1
                if count > k:
                    return True
        return False

    left, right = 0, 0
    ans = []
    for i in range(1, n):
        if isBad(l[i][0]):
            left = i
            break
        if isBad(r[i][1]):
            right = i
            break
    left_count, right_count = 0, 0
    for i in range(left - 1, -1, -1):
        if l[i][1] < l[i + 1][0]:
            left_count += 1
        else:
            break
    for i in range(right, n):
        if r[i][0] > r[i - 1][1]:
            right_count += 1
        else:
            break
    ans.extend(list(range(left - left_count, right + right_count + 1)))
    ans = sorted(ans)
    return ans

