    def merge_tiles(grid: List[List[int]], a_loc: List[int], b_loc: List[int]) -> List[List[int]]:
        a_tile, b_tile = grid[a_loc[0]][a_loc[1]], grid[b_loc[0]][b_loc[1]]
        a_sum, b_sum = a_tile + b_tile, 0
        new_tile = 0

        if a_sum == b_sum:
            new_tile = a_sum
        elif a_sum > b_sum:
            new_tile = a_sum - b_sum
        else:
            new_tile = b_sum - a_sum

        grid[a_loc[0]][a_loc[1]], grid[b_loc[0]][b_loc[1]] = new_tile, new_tile

        return grid

    # 4 move left
    if nums[4] == 1:
        for i in range(4):
            grid[i] = grid[i][::-1]

    # 4 move up
    if nums[4] == 2:
        for i in range(4):
            for j in range(i):
                grid[i][j], grid[j][i] = grid[j][i], grid[i][j]

    # 4 move right
    if nums[4] == 3:
