        lambda x: merge_tiles(grid, x, [x[0] - 1, x[1]]),  # left
        lambda x: merge_tiles(grid, x, [x[0] - 1, x[1] + 1]),  # up-left
        lambda x: merge_tiles(grid, x, [x[0] + 1, x[1]]),  # right
        lambda x: merge_tiles(grid, x, [x[0] + 1, x[1] + 1]),  # down-right
    ]

