def solution(stdin: str) -> str:
    N = int(stdin.readline().strip())
    lengths = list(map(lambda x: int(x), stdin.readline().split()))

    # build a graph with nodes from 0 to N-1
    g = [set() for _ in range(N)]
    for i in range(N):
        for j in range(N):
            if i!= j:
                g[i].add(j)
                g[j].add(i)

    # if we have three odd-length sticks, we can construct a triangle
    if sum([l % 2 == 1 for l in lengths]) == 3:
        return "possible"

    # find all connected components
    components = []
    for component in range(N):
        if component in components:
            continue
        stack = [component]
        visited = set([component])
        while stack:
            node = stack.pop()
            for neighbor in g[node]:
                if neighbor not in visited:
                    visited.add(neighbor)
                    stack.append(neighbor)
        components.append(visited)

    # if there is exactly one connected component, it will have exactly three odd-length sticks
    if len(components) == 1 and sum([len(c) for c in components]) == 3:
        return "possible"

    return "impossible"

