        visited = set()
        visited.add((i, j))
        stack = [(i, j)]
        steps = 0
        while stack:
            i, j = stack.pop(0)
            steps += 1
            if (i, j) == (1, 1):
                return steps
            for di, dj in [(2, 1), (2, -1), (-2, 1), (-2, -1), (1, 2), (1, -2), (-1, 2), (-1, -2)]:
                if 0 <= i + di <= n - 1 and 0 <= j + dj <= n - 1:
